PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE cars (
      itemId TEXT PRIMARY KEY,
      title TEXT,
      shortDescription TEXT,
      priceValue REAL,
      priceCurrency TEXT,
      priceDisplay TEXT,
      itemWebUrl TEXT,
      condition TEXT,
      conditionDescription TEXT,
      itemLocationCity TEXT,
      itemLocationCountry TEXT,
      thumbnailImages TEXT,
      year TEXT,
      make TEXT,
      model TEXT,
      mileage TEXT,
      forSaleBy TEXT,
      fuelType TEXT,
      engine TEXT,
      carType TEXT,
      bodyType TEXT,
      horsePower TEXT,
      numberOfCylinders TEXT,
      numberOfDoors TEXT,
      aspectsJson TEXT,
      insertedAt INTEGER NOT NULL
    );
CREATE TABLE system_state (
      key TEXT PRIMARY KEY,
      value TEXT NOT NULL
    );
CREATE INDEX idx_cars_insertedAt ON cars(insertedAt);
COMMIT;
